●タンク容量：4L。●電動機サイズ：0.375kW・定格電圧：AC100V。●定格周波数：50/60Hz・消費電流：3.7/3.4A。●定格消費電力：290/340W・定格時間：連続。●【商品サイズ】(約)：幅375高さ315奥行335(mm)。●【重量】(約)：10800(g)。 ●【用途】タッカー、小型ネイラー、ブラシ、空気入れなど空気消費量が少ない用途。●【機能・特徴】コンデンサーモーター採用で長寿命です。●従来比80%アップのハイブローワンタッチソケット採用で効率よく作業ができます。●ハンドル付きで持ち運びに便利です。●オイル式に比べクリーンなエアーを供給できて安心です。●空気圧縮方式：レシプロ式(往復動ピストン方式)。●圧力制御範囲：0.8-0.6MPa・最高使用圧力：0.8MPa。●騒音レベル(参考値)(db(A)/1.5m)：67/68。<style type="text/css">
